import logo from './logo.svg';
import ia from  './src/ia.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>PT IT</h1>
      <header className="App-header">
        <img src={ia} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
